min-width: 100vw;

max-height:100vh;
`

const Img = styled.img`
width:100%;
height:100%;


`

class Parallax extends Component {

render() { 
    return (
      <Container>
         <Img src={this.props.img}></Img>
      </Container>
  );
  }
}

